import React from "react";
import { getUserDetails } from "../../utils/api"

export function ApplicationPage() {
    const [user, setUser] = React.useState( null );
    const [loading, setLoading ] = React.useState( true )

    React.useEffect( () => {
        getUserDetails()
        .then( ( { data } ) => {
            console.log( data );
            setUser( data );
            setLoading(false);
        }).catch( (err) => {
            history.push('/');
            setLoading(false);
        })
    }, [])

    return !loading && (
        <h1>Dashboard Page</h1>
    )
}
